  render () {
    return (
      <div id='about' className='section section-hero section-about'>
        <div className='section-hero--copy' data-aos='fade-down'>
          <h1>Contact</h1>
        </div>
        <div className='section-hero--image' data-aos='fade-up'>
          <h2>
            <a href='mailto:mry.mcginty@gmail.com'>mry.mcginty@gmail.com</a>
          </h2>
          <a href='https://linkedin.com/in/mrycollins'>Connect on LinkedIn</a>
        </div>
      </div>
    )
  }
}
export default Contact
